jQuery(function() {
  jQuery('.birthdate-verification').on('keyup', check_birthdate);
});

function years2milliseconds(years) {
  return years * 86400 * 365 * 1000;
}

function check_birthdate() {
  var month = jQuery('.birthday-month').val();
  var day = jQuery('.birthday-day').val();
  var year = jQuery('.birthday-year').val();
  if (!month || !day || year.length < 4) return;
  var birthdate = new Date();
  birthdate.setFullYear(year);
  birthdate.setMonth(month, day);
  var now = new Date().getTime();
  var eighteenyearsago = new Date(now - years2milliseconds(18));
  if (eighteenyearsago < birthdate) {
    jQuery('.birthday-rejected-link').show();
    jQuery('.birthday-continue-link').hide();
    jQuery('.birthday-verification-age').text(birthdate.getFullYear() + 18);
  } else {
    jQuery('.birthday-continue-link').show();
    jQuery('.birthday-rejected-link').hide();
  }
}
